import React from 'react';
import ExperienceItem from './ExperienceItem'; // Adjust the path as needed
import experiencesData from './experiences.json'; // Adjust the path as needed (optional)

const Experience = () => {
  // Sample experience data (replace with your actual data)
  const experiences = experiencesData || [
    {
      company: 'Eagleview',
      website: 'https://www.eagleview.com/',
      text: 'Built a health check monitor for microservices.',
    },
    // Add more experience objects with company, website (optional), and text
  ];

  return (
    <div className="experience-page">
      <h2>EXPERIENCE</h2>
      {experiences.map((experience) => (
        <ExperienceItem key={experience.company} {...experience} />
      ))}
    </div>
  );
};

export default Experience;
